private static String getClusterID(String clusterId, Configuration conf) {
  if (clusterId == null || clusterId.isEmpty()) {
    return conf.get(
        YarnConfiguration.RM_CLUSTER_ID,
            YarnConfiguration.DEFAULT_RM_CLUSTER_ID);
  }
  return clusterId;
}
